INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, "", 1, 0, 0, 1, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, "", 0, 1, 0, 2, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 0, 3, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, "", 0, 1, 0, 4, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1, "", 0, 2, 0, 5, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1, "", 0, 2, 0, 6, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, "", 0, 2, 0, 7, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1, "", 0, 3, 0, 8, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1, "", 0, 3, 0, 9, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, "", 0, 3, 0, 10, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, "", 0, 3, 0, 11, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, "", 0, 3, 0, 12, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1, "", 0, 4, 0, 13, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1, "", 0, 4, 0, 14, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1, "", 0, 4, 0, 15, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, "", 0, 4, 0, 16, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, "", 0, 4, 0, 17, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 2, 0, 0, 18, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, "", 3, 0, 7, 19, 60000);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ハツネ", 0, 101201, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, "", 1, 0, 1, 20, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ハツネ", 0, 101201, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, "", 2, 0, 1, 21, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シオリ", 0, 103801, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 0, "", 1, 0, 1, 22, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シオリ", 0, 103801, 1, "来年も、\n一緒にいられたら…\nうれしいな", 0, "", 2, 0, 1, 23, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キョウカ", 0, 103601, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 0, "", 1, 0, 2, 24, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キョウカ", 0, 103601, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, "", 2, 0, 2, 25, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミミ", 0, 102001, 1, "おにいちゃんとあってから、\n1年たったよ～！", 0, "", 1, 0, 2, 26, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミミ", 0, 102001, 1, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 0, "", 2, 0, 2, 27, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミソギ", 0, 100401, 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 0, "", 1, 0, 2, 28, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミソギ", 0, 100401, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 0, "", 2, 0, 2, 29, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("マホ", 0, 101001, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, "", 1, 0, 3, 30, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("マホ", 0, 101001, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, "", 2, 0, 3, 31, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("イリヤ", 0, 104401, 1, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0, "", 1, 0, 3, 32, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("イリヤ", 0, 104401, 1, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0, "", 2, 0, 3, 33, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カオリ", 0, 101701, 2, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0, "", 1, 0, 3, 34, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カオリ", 0, 101701, 2, "これからも、どうぞよろしく\nお願いするさ～！", 0, "", 2, 0, 3, 35, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("サレン", 0, 102801, 0, "あんたと出会ってからもうそんなに\nたつのね～", 0, "", 1, 0, 4, 36, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("サレン", 0, 102801, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, "", 2, 0, 4, 37, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("スズメ", 0, 102501, 1, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 0, "", 1, 0, 4, 38, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("スズメ", 0, 102501, 1, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0, "", 2, 0, 4, 39, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("タマキ", 0, 104601, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 0, "", 1, 0, 5, 40, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("タマキ", 0, 104601, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, "", 2, 0, 5, 41, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミフユ", 0, 104801, 1, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0, "", 1, 0, 5, 42, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミフユ", 0, 104801, 1, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0, "", 2, 0, 5, 43, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("アキノ", 0, 103201, 0, "あなたさまと出会ってもう1年…", 0, "", 1, 0, 6, 44, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("アキノ", 0, 103201, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, "", 2, 0, 6, 45, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ユカリ", 0, 103401, 1, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0, "", 1, 0, 6, 46, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ユカリ", 0, 103401, 1, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0, "", 2, 0, 6, 47, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("クリスティーナ", 0, 107101, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, "", 1, 0, 7, 48, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("クリスティーナ", 0, 107101, 0, "ともかくこれからも\n愉しませてくれよ☆", 0, "", 2, 0, 7, 49, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ジュン", 0, 104701, 1, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0, "", 1, 0, 7, 50, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ジュン", 0, 104701, 1, "見えないから分からないって？\nそれもそうだな…", 0, "", 2, 0, 7, 51, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("トモ", 0, 103701, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, "", 1, 0, 8, 52, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("トモ", 0, 103701, 0, "これからもよろしくね！", 0, "", 2, 0, 8, 53, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("マツリ", 0, 100501, 1, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0, "", 1, 0, 8, 54, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("マツリ", 0, 100501, 1, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0, "", 2, 0, 8, 55, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミヤコ", 0, 100701, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, "", 1, 0, 9, 56, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミヤコ", 0, 100701, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, "", 2, 0, 9, 57, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シノブ", 0, 103101, 1, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0, "", 1, 0, 9, 58, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シノブ", 0, 103101, 1, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0, "", 2, 0, 9, 59, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("アンナ", 0, 100901, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, "", 1, 0, 10, 60, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("アンナ", 0, 100901, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, "", 2, 0, 10, 61, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ナナカ", 0, 101301, 1, "君と出会ってもう1年だって！\n早いねー！", 0, "", 1, 0, 10, 62, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ナナカ", 0, 101301, 1, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0, "", 2, 0, 10, 63, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミツキ", 0, 105101, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, "", 1, 0, 11, 64, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ミツキ", 0, 105101, 0, "これからも、いろんなところを\n調べさせてね？", 0, "", 2, 0, 11, 65, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ルカ", 0, 105601, 1, "お前さんと出会ってもう1年か\n助太刀するつもりが", 0, "", 1, 0, 11, 66, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ルカ", 0, 105601, 1, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0, "", 2, 0, 11, 67, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("エリコ", 0, 102701, 2, "早いものですわね、あなた様と\nお会いして、もう1年…", 0, "", 1, 0, 11, 68, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("エリコ", 0, 102701, 2, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 0, "", 2, 0, 11, 69, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("アヤネ", 0, 102301, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, "", 1, 0, 12, 70, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("アヤネ", 0, 102301, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, "", 2, 0, 12, 71, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("チカ", 0, 104201, 1, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0, "", 1, 0, 12, 72, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("チカ", 0, 104201, 1, "私のことを見守ってください\nできることなら、ずっと…", 0, "", 2, 0, 12, 73, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("クルミ", 0, 102101, 2, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0, "", 1, 0, 12, 74, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("クルミ", 0, 102101, 2, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 0, "", 2, 0, 12, 75, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シズル", 0, 104901, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, "", 1, 0, 13, 76, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シズル", 0, 104901, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, "", 2, 0, 13, 77, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("リノ", 0, 101101, 1, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0, "", 1, 0, 13, 78, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("リノ", 0, 101101, 1, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0, "", 2, 0, 13, 79, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ユイ", 0, 100201, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, "", 1, 0, 14, 80, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ユイ", 0, 100201, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, "", 2, 0, 14, 81, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ヒヨリ", 0, 100101, 1, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0, "", 1, 0, 14, 82, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ヒヨリ", 0, 100101, 1, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0, "", 2, 0, 14, 83, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("レイ", 0, 100301, 2, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0, "", 1, 0, 14, 84, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("レイ", 0, 100301, 2, "キミに背中を預けられる日が、\n早くきますように", 0, "", 2, 0, 14, 85, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, "", 1, 0, 15, 86, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "これからもずっと、覚えていて\nくださいね！", 0, "", 2, 0, 15, 87, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0, "", 1, 0, 15, 88, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0, "", 2, 0, 15, 89, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0, "", 1, 0, 15, 90, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0, "", 2, 0, 15, 91, 80001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("スズメ", 0, 112101, 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, "", 1, 0, 0, 92, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1, "", 0, 1, 0, 93, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 0, 94, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, "", 0, 1, 0, 95, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, "", 0, 1, 0, 96, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, "", 0, 1, 0, 97, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1, "", 0, 2, 0, 98, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1, "", 0, 2, 0, 99, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1, "", 0, 2, 0, 100, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1, "", 0, 2, 0, 101, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, "", 0, 2, 0, 102, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1, "", 0, 3, 0, 103, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1, "", 0, 3, 0, 104, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, "", 0, 3, 0, 105, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, "", 0, 3, 0, 106, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 1, "", 0, 3, 0, 107, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 1, "", 0, 3, 0, 108, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, "", 0, 3, 0, 109, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1, "", 0, 4, 0, 110, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1, "", 0, 4, 0, 111, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1, "", 0, 4, 0, 112, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, "", 0, 4, 0, 113, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, "", 0, 4, 0, 114, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 1, "", 0, 4, 0, 115, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, "", 0, 4, 0, 116, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("スズメ", 0, 112101, 3, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, "", 2, 0, 0, 117, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("スズメ", 0, 112101, 3, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0, "", 3, 0, 7, 118, 60001);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 0, "", 1, 0, 1, 119, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0, "", 1, 0, 1, 120, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0, "", 2, 0, 1, 121, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "え？　ちょっと\nいきなりなにっ？", 0, "", 1, 0, 1, 122, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0, "", 2, 0, 1, 123, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, "", 2, 0, 1, 124, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, "", 3, 0, 1, 125, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 0, "", 3, 0, 1, 126, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0, "", 3, 0, 1, 127, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0, "", 4, 0, 1, 128, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, "", 4, 0, 1, 129, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0, "", 4, 0, 1, 130, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0, "", 5, 0, 1, 131, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, "", 5, 0, 2, 132, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 1, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0, "", 1, 0, 2, 133, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "げっ…カリンじゃない\nなんでもないわよ！", 0, "", 6, 0, 2, 134, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 1, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0, "", 2, 0, 2, 135, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, "", 7, 0, 2, 136, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 1, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0, "", 3, 0, 2, 137, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, "", 8, 0, 2, 138, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, "", 9, 0, 2, 139, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 1, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0, "", 4, 0, 2, 140, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, "", 10, 0, 2, 141, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 1, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0, "", 5, 0, 2, 142, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, "", 11, 0, 2, 143, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, "", 6, 0, 3, 144, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 1, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0, "", 5, 0, 3, 145, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, "", 7, 0, 3, 146, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, "", 8, 0, 3, 147, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 1, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0, "", 6, 0, 3, 148, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 1, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0, "", 7, 0, 3, 149, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 0, "", 9, 0, 3, 150, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 1, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0, "", 8, 0, 3, 151, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, "", 10, 0, 3, 152, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 1, "えへへ、ありがとうございます\nコッコロちゃん！", 0, "", 9, 0, 3, 153, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, "", 11, 0, 3, 154, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 1, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0, "", 10, 0, 3, 155, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, "", 11, 0, 4, 156, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0, "", 12, 0, 4, 157, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, "", 12, 0, 4, 158, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0, "", 13, 0, 4, 159, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, "", 13, 0, 4, 160, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "…積極的？\nなんの話よ？", 0, "", 14, 0, 4, 161, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, "", 14, 0, 4, 162, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, "", 15, 0, 4, 163, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0, "", 15, 0, 4, 164, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, "", 16, 0, 4, 165, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0, "", 16, 0, 4, 166, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0, "", 17, 0, 4, 167, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, "", 18, 0, 5, 168, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0, "", 12, 0, 5, 169, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, "", 19, 0, 5, 170, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0, "", 13, 0, 5, 171, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, "", 20, 0, 5, 172, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0, "", 14, 0, 5, 173, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, "", 21, 0, 5, 174, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0, "", 15, 0, 5, 175, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "かくし芸？", 0, "", 22, 0, 5, 176, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0, "", 16, 0, 5, 177, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, "", 23, 0, 5, 178, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, "", 17, 0, 6, 179, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0, "", 24, 0, 6, 180, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0, "", 17, 0, 6, 181, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, "", 18, 0, 6, 182, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0, "", 25, 0, 6, 183, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0, "", 18, 0, 6, 184, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0, "", 26, 0, 6, 185, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0, "", 27, 0, 6, 186, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0, "", 28, 0, 6, 187, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, "", 19, 0, 6, 188, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0, "", 19, 0, 6, 189, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0, "", 29, 0, 6, 190, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, "", 30, 0, 7, 191, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, "", 31, 0, 7, 192, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, "", 32, 0, 7, 193, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "あー\nあー\n…声、これで大丈夫かしら？", 0, "", 33, 0, 7, 194, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, "", 34, 0, 7, 195, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "オイッスー☆", 0, "", 35, 0, 7, 196, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, "", 36, 0, 7, 197, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, "", 37, 0, 7, 198, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, "", 38, 0, 7, 199, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, "", 20, 0, 8, 200, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, "", 21, 0, 8, 201, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, "", 22, 0, 8, 202, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, "", 23, 0, 8, 203, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, "", 24, 0, 8, 204, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "オイッスー☆", 0, "", 25, 0, 8, 205, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, "", 26, 0, 8, 206, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, "", 27, 0, 8, 207, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, "", 28, 0, 8, 208, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "オイッスー☆", 0, "", 20, 0, 9, 209, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, "", 21, 0, 9, 210, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "あと６日で2.5周年ですか…", 0, "", 22, 0, 9, 211, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, "", 23, 0, 9, 212, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, "", 24, 0, 9, 213, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "オイッスー☆", 0, "", 25, 0, 9, 214, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, "", 26, 0, 9, 215, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, "", 27, 0, 9, 216, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, "", 28, 0, 9, 217, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, "", 29, 0, 9, 218, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, "", 30, 0, 9, 219, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, "", 31, 0, 10, 220, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0, "", 29, 0, 10, 221, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, "", 32, 0, 10, 222, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "…………", 0, "", 39, 0, 10, 223, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0, "", 30, 0, 10, 224, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0, "", 40, 0, 10, 225, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, "", 33, 0, 10, 226, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0, "", 41, 0, 10, 227, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, "", 34, 0, 10, 228, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, "", 35, 0, 10, 229, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0, "", 42, 0, 10, 230, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0, "", 31, 0, 10, 231, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0, "", 43, 0, 10, 232, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, "", 36, 0, 10, 233, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, "", 6, 0, 11, 234, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, "", 7, 0, 11, 235, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, "", 8, 0, 11, 236, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, "", 9, 0, 11, 237, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, "", 10, 0, 11, 238, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 0, "", 11, 0, 11, 239, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, "", 12, 0, 11, 240, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, "", 13, 0, 11, 241, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "あれ？\nもしかして緊張で気を失って…？", 0, "", 14, 0, 11, 242, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, "", 15, 0, 11, 243, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, "", 16, 0, 11, 244, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "それでは\nまた明日お会いしましょう♪", 0, "", 17, 0, 11, 245, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, "", 44, 0, 12, 246, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 2, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0, "", 37, 0, 12, 247, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0, "", 32, 0, 12, 248, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, "", 45, 0, 12, 249, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 2, "ひどいですよぉキャルちゃ～ん！", 0, "", 38, 0, 12, 250, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0, "", 33, 0, 12, 251, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 2, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0, "", 39, 0, 12, 252, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, "", 46, 0, 12, 253, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0, "", 34, 0, 12, 254, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 2, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0, "", 40, 0, 12, 255, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, "", 41, 0, 13, 256, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0, "", 47, 0, 13, 257, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "忘れてきちゃいました☆", 0, "", 42, 0, 13, 258, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0, "", 48, 0, 13, 259, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0, "", 35, 0, 13, 260, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0, "", 49, 0, 13, 261, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, "", 43, 0, 13, 262, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0, "", 50, 0, 13, 263, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0, "", 36, 0, 13, 264, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0, "", 51, 0, 13, 265, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0, "", 37, 0, 13, 266, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0, "", 52, 0, 13, 267, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, "", 44, 0, 13, 268, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0, "", 38, 0, 13, 269, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, "", 45, 0, 13, 270, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0, "", 53, 0, 13, 271, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, "", 46, 0, 13, 272, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "こんにちは\n【ギルド管理協会】のカリンです", 0, "", 18, 0, 14, 273, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "昨日の生放送は\nいかがだったでしょうか？", 0, "", 19, 0, 14, 274, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, "", 20, 0, 14, 275, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, "", 21, 0, 14, 276, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, "", 22, 0, 14, 277, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, "", 23, 0, 14, 278, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, "", 24, 0, 14, 279, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, "", 25, 0, 14, 280, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, "", 26, 0, 14, 281, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, "", 27, 0, 14, 282, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "準備はいいですかっ？\n…いっきますよー！", 0, "", 47, 0, 15, 283, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "祝！", 0, "", 54, 0, 15, 284, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "2.5周年！", 0, "", 39, 0, 15, 285, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "おめでとうございま～す☆", 0, "", 48, 0, 15, 286, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0, "", 55, 0, 15, 287, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0, "", 40, 0, 15, 288, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, "", 49, 0, 15, 289, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0, "", 56, 0, 15, 290, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0, "", 41, 0, 15, 291, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0, "", 57, 0, 15, 292, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, "", 50, 0, 15, 293, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0, "", 58, 0, 15, 294, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "記念日だから\n平気平気♪\nやばいですね☆", 0, "", 51, 0, 15, 295, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "意味分かんないわよ！", 0, "", 59, 0, 15, 296, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0, "", 42, 0, 15, 297, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0, "", 43, 0, 15, 298, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, "", 52, 0, 15, 299, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 2, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0, "", 60, 0, 15, 300, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0, "", 44, 0, 15, 301, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, "", 53, 0, 15, 302, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ・コッコロ・キャル", 1, 105801, 0, "2.5周年\nありがとうございます！", 0, "105901,45,106001,61", 54, 0, 15, 303, 80003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, "", 1, 0, 0, 304, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, "", 0, 1, 0, 305, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 0, 306, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1, "", 0, 1, 0, 307, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1, "", 0, 1, 0, 308, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, "", 0, 1, 0, 309, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1, "", 0, 2, 0, 310, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1, "", 0, 2, 0, 311, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1, "", 0, 2, 0, 312, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1, "", 0, 2, 0, 313, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, "", 0, 2, 0, 314, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1, "", 0, 3, 0, 315, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1, "", 0, 3, 0, 316, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, "", 0, 3, 0, 317, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1, "", 0, 3, 0, 318, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 1, "", 0, 3, 0, 319, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, "", 0, 3, 0, 320, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, "", 0, 3, 0, 321, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 1, "", 0, 4, 0, 322, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1, "", 0, 4, 0, 323, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1, "", 0, 4, 0, 324, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1, "", 0, 4, 0, 325, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, "", 0, 4, 0, 326, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1, "", 0, 4, 0, 327, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, "", 0, 4, 0, 328, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 2, 0, 0, 329, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, "", 3, 0, 7, 330, 60002);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "ささ、シェフィさまはこちらへ…", 0, "", 1, 0, 1, 331, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "コッコロさん、どこへ行くの…？\n…え？", 0, "", 1, 0, 1, 332, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0, "", 1, 0, 1, 333, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0, "", 2, 0, 1, 334, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "ええと…\n二人とも何をしているの？", 0, "", 2, 0, 1, 335, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0, "", 1, 0, 1, 336, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "あの日…？", 0, "", 3, 0, 1, 337, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0, "", 2, 0, 1, 338, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 0, "", 3, 0, 1, 339, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "やばいですね☆", 0, "", 1, 0, 1, 340, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "って、なにしれっと\n参加してんのよカリン！", 0, "", 2, 0, 1, 341, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0, "", 2, 0, 1, 342, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0, "", 3, 0, 1, 343, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0, "", 4, 0, 1, 344, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 0, "", 4, 0, 1, 345, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0, "", 5, 0, 2, 346, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0, "", 3, 0, 2, 347, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0, "", 4, 0, 2, 348, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0, "", 6, 0, 2, 349, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "さすがでございます\nペコリーヌさま", 0, "", 5, 0, 2, 350, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, "", 3, 0, 2, 351, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 0, "", 5, 0, 2, 352, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0, "", 7, 0, 2, 353, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "さ、次はキャルさまの\n番でございますよ", 0, "", 6, 0, 2, 354, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, "", 4, 0, 2, 355, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0, "", 6, 0, 2, 356, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, "", 5, 0, 2, 357, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, "", 6, 0, 2, 358, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0, "", 7, 0, 2, 359, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, "", 7, 0, 2, 360, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0, "", 8, 0, 3, 361, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0, "", 8, 0, 3, 362, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0, "", 9, 0, 3, 363, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "聖学祭…って、なにかしら？", 0, "", 7, 0, 3, 364, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0, "", 10, 0, 3, 365, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, "", 8, 0, 3, 366, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, "", 9, 0, 3, 367, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0, "", 9, 0, 3, 368, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "いや、そのまんますぎでしょ…", 0, "", 10, 0, 3, 369, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0, "", 8, 0, 3, 370, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0, "", 10, 0, 3, 371, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "えっ？　ええ…\nぎゅーっ…？", 0, "", 9, 0, 3, 372, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, "", 11, 0, 4, 373, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0, "", 10, 0, 4, 374, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, "", 12, 0, 4, 375, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0, "", 11, 0, 4, 376, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, "", 13, 0, 4, 377, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0, "", 11, 0, 4, 378, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, "", 14, 0, 4, 379, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, "", 15, 0, 4, 380, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0, "", 11, 0, 4, 381, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0, "", 12, 0, 4, 382, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0, "", 12, 0, 4, 383, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, "", 16, 0, 4, 384, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0, "", 12, 0, 4, 385, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0, "", 13, 0, 5, 386, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0, "", 14, 0, 5, 387, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0, "", 15, 0, 5, 388, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, "", 17, 0, 5, 389, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, "", 18, 0, 5, 390, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0, "", 13, 0, 5, 391, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0, "", 13, 0, 5, 392, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0, "", 16, 0, 5, 393, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, "", 19, 0, 5, 394, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0, "", 17, 0, 5, 395, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0, "", 18, 0, 5, 396, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0, "", 19, 0, 5, 397, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0, "", 4, 0, 6, 398, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0, "", 5, 0, 6, 399, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "…えっ！？", 0, "", 20, 0, 6, 400, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0, "", 20, 0, 6, 401, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, "", 14, 0, 6, 402, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0, "", 14, 0, 6, 403, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, "", 15, 0, 6, 404, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0, "", 21, 0, 6, 405, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0, "", 21, 0, 6, 406, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "ぶっ殺すぞ！？", 0, "", 22, 0, 6, 407, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0, "", 6, 0, 6, 408, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0, "", 15, 0, 7, 409, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, "", 23, 0, 7, 410, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0, "", 16, 0, 7, 411, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0, "", 22, 0, 7, 412, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, "", 24, 0, 7, 413, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0, "", 17, 0, 7, 414, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0, "", 16, 0, 7, 415, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0, "", 18, 0, 7, 416, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "もちろんでございます\n仲良くお勉強いたしましょう", 0, "", 17, 0, 7, 417, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "しれっと教育ママが\n生まれてる…？", 0, "", 25, 0, 7, 418, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0, "", 23, 0, 7, 419, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "え～～～～！？", 0, "", 26, 0, 7, 420, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, "", 27, 0, 8, 421, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0, "", 19, 0, 8, 422, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0, "", 18, 0, 8, 423, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0, "", 24, 0, 8, 424, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0, "", 20, 0, 8, 425, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, "", 28, 0, 8, 426, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0, "", 19, 0, 8, 427, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0, "", 21, 0, 8, 428, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, "", 29, 0, 8, 429, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, "", 30, 0, 8, 430, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0, "", 25, 0, 8, 431, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, "", 31, 0, 8, 432, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, "", 22, 0, 9, 433, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, "", 23, 0, 9, 434, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, "", 24, 0, 9, 435, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, "", 25, 0, 9, 436, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, "", 26, 0, 9, 437, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "それから、それから…！\nぅ、ぅぅっ…！", 0, "", 27, 0, 9, 438, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "―びえぇぇ～んっ！！！", 0, "", 28, 0, 9, 439, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "どうされましたか、シェフィさま", 0, "", 20, 0, 9, 440, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "ううっ…ひっく…\nママッ…！", 0, "", 29, 0, 9, 441, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0, "", 21, 0, 9, 442, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0, "", 22, 0, 9, 443, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, "", 30, 0, 9, 444, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "主さま\n3.5周年まであと５日\nでございます", 0, "", 23, 0, 10, 445, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "ですがその前に\n生放送がありますね", 0, "", 24, 0, 10, 446, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "…生放送に向けた\n意気込みでございますか？", 0, "", 25, 0, 10, 447, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, "", 26, 0, 10, 448, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, "", 27, 0, 10, 449, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, "", 28, 0, 10, 450, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, "", 29, 0, 10, 451, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, "", 30, 0, 10, 452, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, "", 31, 0, 10, 453, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "3.5周年まであと４日！\nやばいですね☆", 0, "", 26, 0, 11, 454, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0, "", 32, 0, 11, 455, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, "", 27, 0, 11, 456, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, "", 28, 0, 11, 457, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, "", 29, 0, 11, 458, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0, "", 33, 0, 11, 459, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, "", 30, 0, 11, 460, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, "", 31, 0, 11, 461, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, "", 32, 0, 11, 462, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "だからあたしはやるなんて一言も…", 0, "", 34, 0, 11, 463, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 0, "オイッスー☆", 0, "", 33, 0, 11, 464, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "聞きなさいっての！！", 0, "", 35, 0, 11, 465, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "3.5周年まであと３日…\nそして生放送は、明日…", 0, "", 31, 0, 12, 466, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0, "", 32, 0, 12, 467, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "おいっす！\n…こうじゃなかったわね\nええと確か…", 0, "", 33, 0, 12, 468, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0, "", 34, 0, 12, 469, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0, "", 35, 0, 12, 470, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "やってますねシェフィちゃん！", 0, "", 34, 0, 12, 471, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "なによ、考えることは\nみんな同じってこと？", 0, "", 36, 0, 12, 472, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0, "", 32, 0, 12, 473, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "みんな…もちろんよ！", 0, "", 36, 0, 12, 474, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0, "", 35, 0, 12, 475, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0, "", 7, 0, 13, 476, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0, "", 8, 0, 13, 477, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0, "", 36, 0, 13, 478, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0, "", 9, 0, 13, 479, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0, "", 33, 0, 13, 480, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 0, "", 10, 0, 13, 481, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "大丈夫…大丈夫…\nあたしは大丈夫…", 0, "", 37, 0, 13, 482, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0, "", 11, 0, 13, 483, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "あうー？", 0, "", 37, 0, 13, 484, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("みんな", 1, 105801, 4, "あ…", 0, "105901,34,106001,38,190801,12", 37, 0, 13, 485, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0, "", 39, 0, 13, 486, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0, "", 35, 0, 13, 487, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0, "", 38, 0, 13, 488, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0, "", 13, 0, 13, 489, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0, "", 38, 0, 14, 490, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0, "", 39, 0, 14, 491, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, "", 40, 0, 14, 492, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0, "", 36, 0, 14, 493, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0, "", 39, 0, 14, 494, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0, "", 40, 0, 14, 495, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 1, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0, "", 37, 0, 14, 496, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, "", 41, 0, 14, 497, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "へ、へぇ…", 0, "", 40, 0, 14, 498, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0, "", 41, 0, 14, 499, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0, "", 41, 0, 14, 500, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 2, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0, "", 42, 0, 14, 501, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0, "", 42, 0, 15, 502, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "祝！", 0, "", 42, 0, 15, 503, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "3.5周年！", 0, "", 38, 0, 15, 504, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "おめでとうございます！", 0, "", 43, 0, 15, 505, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0, "", 14, 0, 15, 506, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190801, 2, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0, "", 15, 0, 15, 507, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0, "", 43, 0, 15, 508, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0, "", 44, 0, 15, 509, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0, "", 43, 0, 15, 510, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("キャル", 0, 106001, 1, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0, "", 44, 0, 15, 511, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, "", 44, 0, 15, 512, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("シェフィ", 0, 106401, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, "", 45, 0, 15, 513, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0, "", 39, 0, 15, 514, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0, "", 40, 0, 15, 515, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("コッコロ", 0, 105901, 4, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0, "", 41, 0, 15, 516, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("ペコリーヌ", 0, 105801, 3, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0, "", 45, 0, 15, 517, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("みんな", 1, 105801, 4, "これからも\nよろしくおねがいします！", 0, "105901,42,106001,45,106401,46,190801,16", 46, 0, 15, 518, 80005);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, "", 1, 0, 0, 519, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1, "", 0, 1, 0, 520, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 0, 521, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, "", 0, 1, 0, 522, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1, "", 0, 1, 0, 523, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, "", 0, 1, 0, 524, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1, "", 0, 2, 0, 525, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1, "", 0, 2, 0, 526, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 1, "", 0, 2, 0, 527, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 1, "", 0, 2, 0, 528, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, "", 0, 2, 0, 529, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1, "", 0, 3, 0, 530, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1, "", 0, 3, 0, 531, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1, "", 0, 3, 0, 532, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1, "", 0, 3, 0, 533, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 1, "", 0, 3, 0, 534, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1, "", 0, 3, 0, 535, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 2, "", 0, 3, 0, 536, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 1, "", 0, 4, 0, 537, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1, "", 0, 4, 0, 538, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1, "", 0, 4, 0, 539, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 1, "", 0, 4, 0, 540, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1, "", 0, 4, 0, 541, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1, "", 0, 4, 0, 542, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 2, "", 0, 4, 0, 543, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 2, 0, 0, 544, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, "", 3, 0, 7, 545, 60003);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, "", 1, 0, 0, 546, 60004);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1, "", 0, 1, 0, 547, 60004);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1, "", 0, 1, 0, 548, 60004);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は姫吉！　宴でも開きたくなるほどの絶対幸運！\nイメチェンでもしてみるのはどうだ？　ぴょんぴょん、なんてな♪", 1, "", 0, 1, 0, 549, 60004);
