INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 2, "", 0, 3, 0, 558, 60004);
