INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", 2, "", 0, 3, 0, 607, 60006);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？", 1, "", 0, 3, 0, 608, 60006);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。", 2, "", 0, 4, 0, 609, 60006);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("", 0, 0, 2, "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？", 2, "", 0, 4, 0, 610, 60006);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, "", 2, 0, 0, 611, 60006);
INSERT INTO `v1_fe6fa2380cb1b97f63544823e73d9111900c865663de405b920964e169d11caf` VALUES ("カリン", 0, 190804, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, "", 3, 0, 5, 612, 60006);
